package ConsolePros;import org.jetbrains.annotations.NotNull;public class Swapping {    public static String firstName = null;    public static String lastName = null;    public static void swap(@NotNull Swapping swapping){        String temp = swapping.firstName;        swapping.firstName = swapping.lastName;        swapping.lastName = temp;    }    public static void main(String[] args) {        final Swapping swapping = new Swapping();        firstName = "Yousuf";        lastName = "Ali";        swap(swapping);        System.out.println("First Name: "+firstName);        System.out.println("Last Name: "+lastName);    }}